import React from 'react';
import { NavLink } from 'react-router-dom';
export default function Header() {
	return (
		<header
			className="d-flex w-100 p-5 fluid justify-content-between align-items-center "
			style={{
				height: '10%',
				fontSize: '1em',
			}}
		>
			<div
				style={{
					fontWeight: 700,
					fontSize: '1.75em',
					width: '35%',
				}}
			>
				SkyQuest
			</div>
			<div
				className="d-flex justify-content-between"
				style={{
					cursor: 'pointer',

					width: '40%',
				}}
			>
				<NavLink to="/" className="href">
					Home
				</NavLink>
				<NavLink to="/flights" className="href">
					Flights
				</NavLink>
				<NavLink to="/" className="href">
					Attractions
				</NavLink>
				<NavLink to="/" className="href">
					Restaurants
				</NavLink>
			</div>
			<div
				style={{
					width: '25%',
				}}
			>
				<div
					className="p-2"
					style={{
						border: '3px solid white',
						borderRadius: 15,
						width: '30%',
						textAlign: 'center',
						marginLeft: 'auto',
					}}
				>
					Sign in
				</div>
			</div>
		</header>
	);
}
